INSERT INTO `course` VALUES (1,'Primeros Auxilios y RCP','Este curso proporciona a los voluntarios las habilidades esenciales para responder a emergencias médicas básicas. Los participantes aprenderán técnicas de reanimación cardiopulmonar (RCP), manejo de heridas, inmovilización de fracturas y protocolos de actuación en situaciones de emergencia. Es ideal para aquellos que desean estar preparados para ayudar en cualquier situación crítica.',NULL,'2025-02-15 22:17:52','2025-02-15 22:17:52'),(2,'Gestión de Desastres y Resiliencia Comunitaria','Este curso está diseñado para capacitar a los voluntarios en la planificación y respuesta ante desastres naturales y emergencias comunitarias. Los temas incluyen evaluación de riesgos, desarrollo de planes de emergencia, coordinación con agencias locales y estrategias para fortalecer la resiliencia comunitaria. Los participantes adquirirán conocimientos prácticos para apoyar a sus comunidades antes, durante y después de un desastre.',NULL,'2025-02-15 22:17:52','2025-02-15 22:17:52'),(3,'Rescate en Aguas Rápidas e Inundaciones','Técnicas de salvamento en corrientes fuertes y uso de equipos de flotación.',NULL,'2025-03-03 13:29:48','2025-03-03 13:29:48'),(4,'Operaciones con Cuerdas y Rescate Vertical','Descenso controlado, ascenso y rescate en alturas o espacios confinados.',2,'2025-03-03 13:34:52','2025-03-03 13:34:52'),(5,'Editado','Prueba 1',2,'2025-03-03 14:15:59','2025-03-03 14:27:57'),(6,'Curso de prueba','Descripción de curso de prueba.',2,'2025-03-27 01:39:38','2025-03-27 01:39:38'),(7,'Curso de prueba 1','Descripcion de prueba 1',2,'2025-03-27 01:41:31','2025-03-27 01:41:31'),(8,'Curso de prueba 2','Descripción de curso de prueba editada.',2,'2025-03-27 01:46:31','2025-03-27 02:15:22'),(9,'Curso 1','Curso de primero auxilios.',2,'2025-03-27 02:15:48','2025-03-27 02:15:48'),(10,'Curso ','Curso',2,'2025-03-27 02:19:06','2025-03-27 02:19:06'),(11,'Otro curso editado','Otro',2,'2025-03-27 02:19:29','2025-03-27 13:37:51'),(12,'Curso de paracaidismo','Curso de paracaidismo para operaciones de rescate.',2,'2025-03-27 02:21:44','2025-03-27 02:22:37'),(13,'Búsqueda y Rescate en Estructuras Colapsadas','Capacitación en técnicas de localización, estabilización y extracción de víctimas en estructuras colapsadas por terremotos o explosiones.',2,'2025-03-27 02:45:34','2025-03-27 02:45:34'),(14,'Orientación y Navegación con GPS y Brújula','Capacitación para moverse eficazmente en entornos desconocidos o agrestes utilizando brújula, mapas topográficos y sistemas GPS. Fundamental para búsquedas y rescates en áreas remotas. Prueba',2,'2025-03-27 13:27:09','2025-04-09 19:33:43'),(15,'Cursillo','Descripción del cursillo',2,'2025-04-06 12:36:04','2025-04-06 12:36:04'),(16,'Cursillo 2','Corrección de descripción del curso',2,'2025-04-06 12:37:27','2025-04-06 13:00:40');
